import Navbar from "./components/Navbar.js";
import AboutMe from "./components/AboutMe.js";
import "./index.css";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (

    <BrowserRouter>
      <div>
        <header>
          <Navbar/>
          </header>
      </div>
      <AboutMe/>
    </BrowserRouter>

  );
}

export default App;
